column8:
スタンダードなインタークーラーキットでも、スペック面では上位モデルに引けを取らない性能を発揮します。オフセットタイプのインナーチューブ、ルーバータイプのアウターフィンを採用。また全てにポリッシュ加工を施したアルミ製パイプとサイドタンク、パイプジョイントには3プライのブルーシリコンを採用するなど、「INTER COOLER CS」と比較しても冷却性能には遜色の無いスペックを実現しています。 <br>●エンジン型式：1JZ-GTE  ●コアサイズ：266×620×76mm ●フィン形状：オフセットインナーフィン ●コアタイプ：TYPE JS（チューブタイプ） ●コアコーティング：なし ●パイプ処理：ポリッシュ加工 ●サイドタンク処理：ポリッシュ加工 ●ジョイントパイプ：シリコン製 3プライ ●ホースバンド：ステンレス製 ●製品画像は商品イメージです。<br>【納期】お取り寄せ商品のため通常3～4日でのお届けとなります。(日・祝日・離島は除く)万が一欠品の場合は別途メールにてご連絡差し上げます。お急ぎの場合はご注文前に必ず納期確認を頂きますようお願い申し上げます。 <br>適合車種：92/10-96/09 JZX90 クレスタ <br>　車検対応品<br>冷却系/インタークーラー<tr><td colspan="2">
