高ブースト圧時に必要な高い冷却性能を持つフィンピッチの細かいコアを採用しつつ、熱交換率の高い特殊なアルミニウム素材を採用することで冷却性能を特に重視したインタークーラーです。ＧＲｅｄｄｙタービンキットなどで発生する吸入空気の熱量にジャストフィットする容量を備えています。ＨＧモデルはサイドタンクとアルミインテークパイプをバフ研磨仕上げ。 <br>コアタイプ：TYPE24C　 コアサイズ：H284/L600/W76　 交換場所：ラジエター前<br>※MC後。純正タービン専用。KIT取付の際AIRINX SET（品番MZ-M005B)が必要。純正フォグランプ取り外し必要。ABS車取付不可。　　※画像はイメージです。車種により付属品構成は異なります。 <br>対応車種：JZA80 スープラ(2JZ-GTE 93/05-02/08) <br>　<br>冷却系/インタークーラー<tr><td colspan="2">
